MySQL [test]> 
CREATE TABLE `canal_test1` (
  `a` int(11) NOT NULL COMMENT "",
  `b` datetime NOT NULL COMMENT ""
) ENGINE=OLAP
UNIQUE KEY(`a`)
COMMENT "OLAP"
DISTRIBUTED BY HASH(`a`) BUCKETS 8
PROPERTIES (
"replication_allocation" = "tag.location.default: 1",
"in_memory" = "false",
"storage_format" = "V2"
);

MySQL [test]> insert into canal_test1 values(1,'2022-08-29 17:19:08');
